DROP TABLE IF EXISTS `player_game_statistics`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `player_game_statistics` (
  `SSN` int(9) unsigned NOT NULL,
  `Home_team` varchar(50) DEFAULT NULL,
  `Away_team` varchar(50) DEFAULT NULL,
  `Game_date` date NOT NULL,
  `Minutes` int(10) unsigned NOT NULL DEFAULT '0',
  `fg_made` int(10) unsigned NOT NULL DEFAULT '0',
  `fg_attempt` int(10) unsigned NOT NULL DEFAULT '0',
  `three_pt_attempt` int(10) unsigned NOT NULL DEFAULT '0',
  `three_pt_made` int(10) unsigned NOT NULL DEFAULT '0',
  `ft_attempt` int(10) unsigned NOT NULL DEFAULT '0',
  `ft_made` int(10) unsigned NOT NULL DEFAULT '0',
  `plus_minus` int(11) NOT NULL DEFAULT '0',
  KEY `PGSTATFK_DATE` (`Game_date`),
  KEY `PGSTATFK_HOME` (`Home_team`),
  KEY `PGSTATFK_AWAY` (`Away_team`),
  KEY `PGSTATFK_PLAYER` (`SSN`),
  CONSTRAINT `PGSTATFK_AWAY` FOREIGN KEY (`Away_team`) REFERENCES `team` (`Name`) ON UPDATE CASCADE,
  CONSTRAINT `PGSTATFK_DATE` FOREIGN KEY (`Game_date`) REFERENCES `game` (`Game_date`),
  CONSTRAINT `PGSTATFK_HOME` FOREIGN KEY (`Home_team`) REFERENCES `team` (`Name`) ON UPDATE CASCADE,
  CONSTRAINT `PGSTATFK_PLAYER` FOREIGN KEY (`SSN`) REFERENCES `player` (`SSN`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
